// Gallery images
const galleryImages = [
  { src: './images/1.jpeg'},
  { src: './images/2.jpeg'},
  { src: './images/3.jpeg'},
  { src: './images/4.jpeg'},
  { src: './images/5.jpeg' },
  { src: './images/6.jpeg'},
  { src: './images/7.jpeg'},
  { src: './images/8.jpeg'},
  { src: './images/9.jpeg'},
  { src: './images/10.jpeg'},
];

const App: React.FC = () => {
  const [typedText, setTypedText] = useState('');

  // Typing effect for the birthday message
  useEffect(() => {
    let index = 0;
    const interval = setInterval(() => {
      setTypedText((prev) => prev + messageText.charAt(index));
      index++;
      if (index >= messageText.length) clearInterval(interval);
    }, 40);
    return () => clearInterval(interval);
